import React, { Component } from "react";

import "./App.css";

class App extends Component {
  state = {
    items: [
      { id: 1, name: "ahmed", age: 24 },
      { id: 2, name: "wahed", age: 30 },
      { id: 3, name: "mido", age: 24 },
    ],
  };
  render() {
    return <div></div>;
  }
}

export default App;
